#include <bits/stdc++.h>
using namespace std;
class Solution{
public:
    int uniquePathsWithObstacles(vector<vector<int>> &obstacleGrid){
        ios::sync_with_stdio(0);
        cin.tie(0);
        cout.tie(0);
        int m = obstacleGrid.size(), n = obstacleGrid[0].size();
        int* dp  = new int[n]{};
        dp[0]=1;
        for (int i = 0; i < m; i++){
            if(obstacleGrid[i][0]){
                dp[0]=0;
            }
            for (int j = 1; j < n; j++){
                if(obstacleGrid[i][j]){
                    dp[j]=0;
                }else{
                    dp[i] += dp[i-1];
                }
            }
        }
        return dp[n-1];
    }
};
